import React from 'react'
import './Landing.css'
import logo from '../images/j1.svg'
import PropTypes from 'prop-types'

const Landing = props => {
    return (
        <div className="w-full h-full" >
            <h1> The Open Source Sneaker API</h1>
            <p> We're building an ecosystem for sneakerheads, sneaker enthusiast and casual sneaker wearers to find a sorts of sneakers.</p>
            <p> It is easy to contribute.</p>

            <div className="flex flex-row">
                <button>View Docs</button>
                <button> View Product</button>
            </div>

            <section>
                <div className="hero-illustration">
                    <div className="hero-squares hero-squares-1 is-revealing"> </div>
                    <div className="hero-ball hero-ball-1 is-revealing">
                        <img  
                            src={logo}
                            style={{
                                "width":"400",
                                "height":"400",
                                "viewBox":"0 0 400 400",
                                "borderRadius": "50%",
                                "alt":""
                            }}
                        />
                    </div>
                    <div className="hero-ball hero-ball-2 is-revealing">
                        <img  
                            src={logo}
                            style={{
                                "width":"200",
                                "height":"200",
                                "viewBox":"0 0 200 200",
                                "borderRadius": "50%",
                                "alt":""
                            }}
                        />
                    </div>
                    <div className="hero-illustration-browser is-revealing"
                    >
                        <img  
                            src={logo}
                            style={{
                                "width":"840",
                                "height":"450",
                                "viewBox":"0 0 840 450",
                                "borderRadius": "50%",
                                "alt":""
                            }}
                        />
                    </div>
                    <div className="hero-ball hero-ball-3 is-revealing">
                        <img  
                            src={logo}
                            style={{
                                "width":"80px",
                                "height":"80px",
                                "viewBox":"0 0 80 80",
                                "borderRadius": "50%",
                                "alt":""
                            }}
                        />
                    </div>
                    <div className="hero-ball hero-ball-4 is-revealing">
                        <img  
                            src={logo}
                            style={{
                                "width":"40px",
                                "height":"40px",
                                "viewBox":"0 0 40 40",
                                "borderRadius": "50%",
                                "alt":""
                            }}
                        />
                    </div>
                    <div className="hero-ball hero-ball-5 is-revealing">
                        <img  
                            src={logo}
                            style={{
                                "width":"24",
                                "height":"24",
                                "viewBox":"0 0 24 24",
                                "borderRadius": "50%",
                                "alt":""
                            }}
                        />
                    </div>

                </div>

            </section>

        </div>
    )
}

Landing.propTypes = {

}

export default Landing
